import Container from './Container.js'
import SmallContainer from './SmallContainer.js'
import Header from './Header'
import H1 from './H1'
import P from './P'
import Button from './Button'
import Br from './Br.js'

import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom'


class Home extends React.Component {
	render() {
		return(
			<Container>
				<Header width='100'>
					<H1 big>MY TABLETOP HERO</H1>
					<P big>Begin your fable right. Become a Tabletop Hero.</P>
				</Header>
				<SmallContainer width='200'>
				<Button display=''><Link to='/play'>Create Character</Link></Button>
				<br />
				<Button color='secondary' display=''>Login</Button>
				</SmallContainer>

			</Container>
		);
	}

}

export default Home;
